/*
    sjisconv package is shift jis code to Unicode converter

	Functions

	func Sjistojis(sjis []byte) []byte
		Shit_jis string to jis string convert.

	func SjistoUtf16(src []byte) []uint16
		Shit_jis string to utf16 string convert.
		return array is compatible with Golang unicode.utf16.
	
	func JisX0213toUtf16(men, ku, ten uint16) []uint16 {		
		JIS X 0213 men,ku,ten code to utf16 string.
		Use a surrogate pair if necessary.

	JIS code to Unicode convert table with reference to this site
	http://x0213.org/
*/

package sjisconv


func Sjistojis(sjis []byte) []byte {
	jis := make([]byte, 2)

	jis[0] = sjis[0]
	jis[1] = sjis[1]
	if jis[0] <= 0x9f {
		jis[0] -= 0x71
	} else {
		jis[0] -= 0xb1
	}
	jis[0] *= 2
	jis[0]++

	if jis[1] >= 0x7F {
		jis[1] -= 0x01
	}
	if jis[1] >= 0x9e {
		jis[1] -= 0x7d
		jis[0]++
	} else {
		jis[1] -= 0x1f
	}
	return jis
}

func SjistoUtf16(src []byte) []uint16 {
	max := len(src)

	buf := make([]uint16, max*2)
	bufindex := 0
	i := 0
	c1 := uint16(0)
	c2 := uint16(0)
	for i < max {
		c1 = uint16(src[i])
		i++

		if (c1 > 0xA0) && (c1 < 0xE0) {
			// 半角カナ
			c1 += (0xFF60 - 0xA0)
			buf[bufindex] = c1
			bufindex++
		} else if c1 >= 0xF0 {
			// Shift_jis-2004
			ten := uint16(src[i])
			i++
			// 第2バイトは、区番号が奇数なら0x40--0x9e (0x7fを除く)、 偶数なら0x9f--0xfcの領域
			men := uint16(2)
			ku := uint16(0)
			if ten < 0x40 {
				continue
			}
			if ten > 0xfc {
				continue
			}
			if ten < 0x9f {
				ten -= 0x3f
				switch c1 {
				case 0xF0:
					ku = 1
				case 0xF1:
					ku = 3
				case 0xF2:
					ku = 5
				case 0xF3:
					ku = 13
				case 0xF4:
					ku = 15
				case 0xF5:
					ku = 79
				case 0xF6:
					ku = 81
				case 0xF7:
					ku = 83
				case 0xF8:
					ku = 85
				case 0xF9:
					ku = 87
				case 0xFA:
					ku = 89
				case 0xFB:
					ku = 91
				case 0xFC:
					ku = 93
				default:
					continue
				}
			} else {
				ten -= 0x9e
				switch c1 {
				case 0xF0:
					ku = 8
				case 0xF1:
					ku = 4
				case 0xF2:
					ku = 12
				case 0xF3:
					ku = 14
				case 0xF4:
					ku = 78
				case 0xF5:
					ku = 80
				case 0xF6:
					ku = 82
				case 0xF7:
					ku = 84
				case 0xF8:
					ku = 86
				case 0xF9:
					ku = 88
				case 0xFA:
					ku = 90
				case 0xFB:
					ku = 92
				case 0xFC:
					ku = 94
				default:
					continue
				}
			}
			s16 := JisX0213toUtf16(men, ku, ten)
			for _, u := range s16 {
				buf[bufindex] = uint16(u)
				bufindex++
			}
		} else if c1 >= 0x80 {
			c2 = uint16(src[i])
			i++
			jis0 := c1
			jis1 := c2

			if jis0 <= 0x9f {
				jis0 -= 0x71
			} else {
				jis0 -= 0xb1
			}

			jis0 <<= 1
			jis0++

			if jis1 >= 0x7F {
				jis1 -= 0x01
			}

			if jis1 >= 0x9e {
				jis1 -= 0x7d
				jis0++
			} else {
				jis1 -= 0x1f
			}

			c := jis213page1[jis0-0x20-1][jis1-0x20-1]

			// 1byte系を変換
			if c < 0x80 {
				c = (c - 0x20 + 0xFF00)
			} else if c < 0xD0 {
				c = (c - 0x40 + 0xFF00)
			}
			buf[bufindex] = c
			bufindex++
		} else {
			buf[bufindex] = c1 & 0xff
			bufindex++
		}
	}
	return buf[0:bufindex]
}

func JisX0213toUtf16(men, ku, ten uint16) []uint16 {
	if ku < 1 {
		return nil
	}
	if ku > 94 {
		return nil
	}
	if ten < 1 {
		return nil
	}
	if ten > 94 {
		return nil
	}
	if (men != 1) && (men != 2) {
		return nil
	}
	var c1 uint16
	if men == 1 {
		c1 = jis213page1[ku-1][ten-1]
	} else if men == 2 {
		c1 = jis213page2[ku-1][ten-1]
	}
	s := make([]uint16, 4)
	sindex := 0
	if (c1 >= 0xD800) && (c1 <= 0xD948) {
		ix := int(c1 - 0xD801)
		ix <<= 1
		if ix < 0 {
			return nil
		}
		if ix >= len(surrogatetable) {
			return nil
		}
		s1 := surrogatetable[ix]
		s2 := surrogatetable[ix+1]
		s[sindex] = s1
		sindex++
		s[sindex] = s2
		sindex++

	} else {
		s[sindex] = c1
		sindex++
	}

	return s[0:sindex]
}

